import IndexMenu from "./indexMenu";

const renderDeviceIndexMenu = (display, filteredSearch, relevantSearch) => {
  if (display) {
    if (filteredSearch.length === 0) return <div></div>

    return <IndexMenu
      relevantSearch={relevantSearch} 
      index1={["MAC Address", "mac"]} 
      index2={["User", "user"]} 
      index3={["Primary Line", "primary"]} 
      index4={["Line Mask", "mask"]} 
      index5={["IP Address", "ip"]}
      index6={["Location", "location"]}
    />
  }
}

export default renderDeviceIndexMenu

